import { Component, Input } from '@angular/core';

@Component({
  selector: 'app-documentos',
  templateUrl: './documentos.component.html',
  styleUrls: ['./documentos.component.css']
})
export class DocumentosComponent {
  @Input() nombreInputNombre: string = "";
  @Input() nombreInputDocumento: string = "";
  @Input() modeloNombre: string = "";
  @Input() modeloDocumento: string | null = "";

}
<span>
  <input type="text" name="nombreInputNombre" placeholder="Nombre del documento" [(ngModel)]="modeloNombre" />
  <input type="file" name="nombreInputDocumento" [(ngModel)]="modeloDocumento">
</span>
